import React from 'react';
import {
  ReservationWrapper,
  BackgroundWrapper,
  DateSearchWrapper,
  Text,
} from './ReservationStyle';

const Reservation: React.FC = () => {
  return (
    <BackgroundWrapper>
      <ReservationWrapper>
        <DateSearchWrapper>
          <Text>날짜 검색하기</Text>
        </DateSearchWrapper>
      </ReservationWrapper>
    </BackgroundWrapper>
  );
};

export default Reservation;
